css:
.feedback-status:before {
  text-align: center;
}
.feedback a {
  text-decoration: underline;
}
.feedback .initially-hidden {
  display: none;
}
.feedback ::-webkit-input-placeholder {
  color: #999999;
}
.feedback textarea,
.feedback input[type=text] {
  width: 100%;
  background-color: #ffffff;
  border: 1px solid rgba(159, 159, 159, 0.9);
  color: #444444;
  padding: 3.3333333333333335px 5px;
}
.feedback label {
  margin-left: 10px;
}
.feedback .email {
  color: #999999;
}
.feedback .sending-error {
  margin-top: 10px;
  color: #ff982d;
}
